type memFile struct {
	r		io.ReadCloser
	offset	int64
	name    string
	modTime time.Time
	path    string
	length  int64
	size    int64
}

func (m memFile) Close() error {
	return m.r.Close()
}
func (m memFile) Read(p []byte) (n int, err error) {
	return m.r.Read(p)
}

func (m memFile) Size() int64 {
	return m.size
}

func (m memFile) Name() string {
	return m.name
}

func (m memFile) ModTime() time.Time {
	return m.modTime
}

func (m memFile) Path() string {
	if m.path == "" {
		return "/"
	}

	return m.path
}

type loader struct {
	fm map[string]memFile
}

func (l loader) Load(name string) (File, error) {
	if !strings.HasPrefix(name, "/") {
		name = "/" + name
	}

	if v, ok := l.fm[name]; ok {
		r, err := zlib.NewReader(strings.NewReader(vaultAssetBinReact[v.offset : v.offset+v.length]))
		if err != nil {
			return nil, err
		}
		v.r = r
		return &v, nil
	}
	return nil, ErrNotFound
}

